import * as S from './ProjectImg.style';

function ProjectImg() {
  return (
    <S.Wrapper>
      <S.Img>
        프로젝트 이미지가 있는 곳
        <S.LikeIcon />
        <S.ViewIcon />
      </S.Img>
    </S.Wrapper>
  );
}

export default ProjectImg;
